Testimony 3 by White claims, "That is when I saw this glass light stand." He states this regarding his visit to the Fey & Co. Law Offices "the week before the murder."

However, Evidence 3, the Receipt, is a receipt for a glass light stand purchased the day before the murder. This means the glass light stand did not exist in the office during White’s visit a week before the murder, contradicting White’s testimony that he saw it then.

