Cody Hackins gives testimony 3: "But the lens wouldn't open in time, so I missed it." This suggests that he failed to take any photos during the crucial moment of the Steel Samurai's victory scene.

However, Evidence 14 ("Path to Glory") is a collection of photos showing every victory scene of the Steel Samurai—in other words, Cody did manage to take pictures of victory scenes, contradicting his claim that he missed the shot.

