Testimony 3 from Bikini claims: "It takes 15 minutes to walk to Dusky Bridge, but less than 5 using one of those!" This suggests that it's possible for someone to get from the Temple to Dusky Bridge quickly with a snowmobile.

However, Evidence 14, Tracks Photo, shows only a single set of snowmobile tracks leading from the Main Gate to Dusky Bridge, indicating the snowmobile was only used once in that path, not back and forth in the manner implied. This creates a contradiction: if multiple trips with the snowmobile happened during the relevant time frame, there should be multiple sets of tracks.

{"evidence": 14, "testimony": 3}

Evidence 14 (Tracks Photo) likely shows tracks in the snow from the Main Gate to Dusky Bridge. If Iris claimed she dragged the body across Dusky Bridge (Testimony 3), but the snow had already stopped when the murder took place (Testimony 6), then any tracks in the snow would have been created before or during the snowfall. However, if the photo shows tracks, yet Iris claims she dragged the body across after the snow stopped (and perhaps after the snow would have already hidden earlier tracks), this would be a contradiction, but the more direct contradiction is:

Evidence 14 (Tracks Photo) and Testimony 3 (Iris claims to have dragged the body across the bridge). If there are no drag marks or only one set of footprints in the photo, it would contradict her testimony.

