One clear contradiction appears between Evidence 3 (Study Photo) and Testimony 3 (Sarge: "From my window, I saw the one designated 'Datz' getting ejected from the premises.").

Based on Sarge's testimony, Datz was thrown out of the house and thus should not have been able to linger inside to commit the murder. However, the Study Photo (Evidence 3) shows the scene as seen by Atishon, placing him as a witness to Datz fleeing—implying Datz left and the window was closed, with no sign he re-entered. This means Datz could not have been in the study later to commit the murder, contradicting the implication in Sarge's testimony.

