Testimony 3 by Amara states: "Minister Inga was the sole victim. There was no other spirit to channel until he was dead." This suggests there was only one person who died in the tomb, thus only one spirit available to be channeled after the murder.

However, Evidence 20 (Mysterious Bloodstain) states: "A bloodstain from Amara's Tomb. This bloodstain found had been wiped up by someone. Analysis reveals that it's Dhurke's blood." This strongly implies that not only Inga, but also Dhurke was killed in the tomb, contradicting Amara's claim that Inga was the sole victim.

