Evidence 17, the candelabra, bears the fingerprints of Gloomsbury's left hand (his dominant hand) and is stained with blood that matches the blood on the lift. This suggests that after being attacked, Gloomsbury was still alive and capable of gripping objects with his dominant, uninjured hand, indicating he was not dead immediately after the initial attack. 

However, Testimony 3 from Nichody claims he hid the "still-warm body" in the lantern; if Gloomsbury was already dead at this point, he should not have had the capacity to grasp the candelabra with his left hand and leave fingerprints and blood. This presents a contradiction between the timeline and state of the body versus the evidence of Gloomsbury's actions after the initial attack.

